import { Typography } from "@material-ui/core";
import React from "react";

const ADate = ({date})=>{
    const today = {date}
    const formatYmd = today => date.toISOString().slice(0, 10);
    const currentDate = `${formatYmd}`
    return(
        <Typography>
           {currentDate}
        </Typography>
    )
};

export default ADate;
